svg.script:
window.addEventListener('load', function() {
  var svg = document.documentElement;
  var allEls = Array.from(svg.querySelectorAll('path, polygon, rect'));

  // Freeze each element hidden (dashoffset = length), no transition yet
  allEls.forEach(function(el) {
    var len = el.getTotalLength ? Math.ceil(el.getTotalLength()) : 800;
    el.style.strokeDasharray  = len + 'px';
    el.style.strokeDashoffset = len + 'px';
    el.style.transition = 'none';
  });

  // Force reflow so hidden state is committed
  svg.getBoundingClientRect();

  // Now apply transition and animate to 0 (fully drawn)
  requestAnimationFrame(function() {
    requestAnimationFrame(function() {
      allEls.forEach(function(el) {
        el.style.transition = 'stroke-dashoffset 3.5s cubic-bezier(0.65, 0, 0.2, 1)';
        el.style.strokeDashoffset = '0';
      });
    });
  });
});
